    'index.html': {
      url: 'index.html',
      title: 'getting-started - index',
      body:
        "\n                   \n\nAngular Chartist\n\n\n\nDemo\nhttps://willsoto.github.io/ng-chartist/demo/\nDocs\nhttps://willsoto.github.io/ng-chartist/docs/\nTable of contents\n\nAbout\nInstallation\nDocumentation\nDevelopment\nLicense\n\nAbout\nChartist component for Angular 4+\nInstallation\nyarn\n# install ng-chartist and chartist\nyarn add ng-chartist chartist\n\n# install chartist typings\nyarn add --dev @types/chartistnpm\n# install ng-chartist and chartist\nnpm i --save ng-chartist chartist\n\n# install chartist typings\nnpm i --save-dev @types/chartistAdd Chartist CSS styles to your application:\nAdd to styles section in angular.json file:\n\"styles\": [\n  \"node_modules/chartist/dist/chartist.css\",\n  \"src/style.scss\"\n],Usage\n// app.module.ts\nimport { ChartistModule } from 'ng-chartist';\n\n@NgModule({\n  imports: [\n    ChartistModule // add ChartistModule to your imports\n  ]\n})\nexport class AppModule {}// bar-chart.component.ts\nimport {\n  IBarChartOptions,\n  IChartistAnimationOptions,\n  IChartistData\n} from 'chartist';\nimport { ChartEvent, ChartType } from 'ng-chartist';\n\n@Component({\n  selector: 'app-bar-chart',\n  template: `\n    \n  `\n  ]\n})\nexport class BarChartComponent {\n  type: ChartType = 'Bar';\n  data: IChartistData = {\n    labels: [\n      'Jan',\n      'Feb',\n      'Mar',\n      'Apr',\n      'May',\n      'Jun',\n      'Jul',\n      'Aug',\n      'Sep',\n      'Oct',\n      'Nov',\n      'Dec'\n    ],\n    series: [\n      [5, 4, 3, 7, 5, 10, 3, 4, 8, 10, 6, 8],\n      [3, 2, 9, 5, 4, 6, 4, 6, 7, 8, 7, 4]\n    ]\n  };\n\n  options: IBarChartOptions = {\n    axisX: {\n      showGrid: false\n    },\n    height: 300\n  };\n\n  events: ChartEvent = {\n    draw: (data) => {\n      if (data.type === 'bar') {\n        data.element.animate({\n          y2: {\n            dur: '0.5s',\n            from: data.y1,\n            to: data.y2,\n            easing: 'easeOutQuad'\n          }\n        });\n      }\n    }\n  };\n}You may also find it useful to view the demo source.\nDocumentation\nAll documentation is auto-generated from the source via compodoc and can be viewed here\nDevelopment\nPrepare your environment\n\nInstall Node.js and yarn\nInstall local dev dependencies: yarn install while current directory is this repo\n\nDevelopment server\nRun yarn run build:lib and then yarn start to start a development server.\nTesting\nRun yarn test to run tests.\nLicense\nApache-2.0\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"
    },
